Syntax coalesce-expression: logical-inc-OR-expression-1 logical-inc-OR-expression-1 ?? coalesce-expression Semantics Given the expression e1 ?? e2, if e1 is set and not NULL (i.e. TRUE for isset ), then the result is e1. Otherwise, then and only then is e2 evaluated, and the result becomes the result of the whole expression. There is a sequence point after the evaluation of e1. Note that the semantics of ?? is similar to isset so that uninitialized variables will not produce warnings when used in e1. This operator associates right-to-left. Examples $arr = ["foo" => "bar", "qux" => NULL];
$obj = (object)$arr; $a = $arr["foo"] ?? "bang"; // "bar" as $arr["foo"] is set and not NULL
$a = $arr["qux"] ?? "bang"; // "bang" as $arr["qux"] is NULL
$a = $arr["bing"] ?? "bang"; // "bang" as $arr["bing"] is not set $a = $obj->foo ?? "bang"; // "bar" as $obj->foo is set and not NULL
$a = $obj->qux ?? "bang"; // "bang" as $obj->qux is NULL
$a = $obj->bing ?? "bang"; // "bang" as $obj->bing is not set $a = NULL ?? $arr["bing"] ?? 2; // 2 as NULL is NULL, and $arr["bing"] is not set function foo() { echo "executed!", PHP_EOL;
}
var_dump(true ?? foo()); // outputs bool(true), "executed!" does not appear as it short-circuits

