Syntax simple-assignment-expression: variable = assignment-expression list-intrinsic = assignment-expression Constraints If the location designated by the left-hand operand is a string element, the key must not be a negative-valued int, and the right-hand operand must have type string. Semantics If assignment-expression designates an expression having value type, see assignment for scalar types If assignment-expression designates an expression having handle type, see assignment for object and resource types . If assignment-expression designates an expression having array type, see assignment of array types . The type and value of the result is the type and value of the left-hand operand after the store (if any [see below]) has taken place. The result is not an lvalue. If the location designated by the left-hand operand is a non-existent array element, a new element is inserted with the designated key and with a value being that of the right-hand operand. If the location designated by the left-hand operand is a string element, then if the key is a negative-valued int, there is no side effect. Otherwise, if the key is a non-negative-valued int, the left-most single character from the right-hand operand is stored at the designated location; all other characters in the right-hand operand string are ignored. If the designated location is beyond the end of the destination string, that string is extended to the new length with spaces (0x20) added as padding beyond the old end and before the newly added character. If the right-hand operand is an empty string, the null character \0 (0x00) is stored. Examples $a = $b = 10 // equivalent to $a = ($b = 10)
$v = array(10, 20, 30);
$v[1] = 1.234; // change the value (and type) of an existing element
$v[-10] = 19; // insert a new element with int key -10
$v["red"] = TRUE; // insert a new element with string key "red"
$s = "red";
$s[1] = "X"; // OK; "e" -> "X"
$s[-5] = "Y"; // warning; string unchanged
$s[5] = "Z"; // extends string with "Z", padding with spaces in [3]-[5]
$s = "red";
$s[0] = "DEF"; // "r" -> "D"; only 1 char changed; "EF" ignored
$s[0] = ""; // "D" -> "\0"
$s["zz"] = "Q"; // warning; defaults to [0], and "Q" is stored there
// -----------------------------------------
class C { ... }
$a = new C; // make $a point to the allocated object list intrinsic Syntax list-intrinsic: list ( list-expression-list ) list-expression-list: unkeyed-list-expression-list keyed-list-expression-list ,opt unkeyed-list-expression-list: list-or-variable , unkeyed-list-expression-list , list-or-variableopt keyed-list-expression-list: expression =&gt; list-or-variable keyed-list-expression-list , expression =&gt; list-or-variable list-or-variable: list-intrinsic &amp;opt variable Constraints list-intrinsic must be used as the left-hand operand in a simple-assignment-expression of which the right-hand operand must be an expression that designates an array or object implementing the ArrayAccess interface (called the source array ). Each variable in list-or-variable must designate a writable variable (called the target variable ). At least one of the elements of the list-expression-list must be non-empty. Semantics This intrinsic assigns one or more elements of the source array to the target variables. Target variables may be assigned by reference. On success, it will return a copy of the source array. If the source array is not an array or object implementing ArrayAccess no assignments are performed and the return value is NULL. For unkeyed-list-expression-list , all elements in the source array having keys of type string are ignored. The element having an int key of 0 is assigned to the first target variable, the element having an int key of 1 is assigned to the second target variable, and so on, until all target variables have been assigned. Any other array elements are ignored. If there are fewer source array elements having int keys than there are target variables, the unassigned target variables are set to NULL and a non-fatal error is produced. For keyed-list-expression-list , each key-variable pair is handled in turn, with the key and variable being separated by the => symbol. The element having the first key, with the key having been converted using the same rules as the subscript operator , is assigned to the frst target variable. This process is repeated for the second => pair, if any, and so on. Any other array elements are ignored. If there is no array element with a given key, the unassigned target variable is set to NULL and a non-fatal error is produced. The assignments must occur in this order. Any target variable may be a list, in which case, the corresponding element is expected to be an array. If the source array elements and the target variables overlap in any way, the behavior is unspecified. Examples list($min, $max, $avg) = array(0, 100, 67); // $min is 0, $max is 100, $avg is 67
list($min, $max, $avg) = array(2 => 67, 1 => 100, 0 => 0); // same as example above
list($min, , $avg) = array(0, 100, 67); // $min is 0, $avg is 67
list($min, $max, $avg) = array(0, 2 => 100, 4 => 67); // $min is 0, $max is NULL, $avg is 100
list($min, list($max, $avg)) = [0, [1 => 67, 99, 0 => 100], 33]; // $min is 0, $max is 100, $avg is 67 list($arr[1], $arr[0]) = [0, 1]; // $arr is [1 => 0, 0 => 1], in this order
list($arr2[], $arr2[]) = [0, 1]; // $arr2 is [0, 1] $a = [1, 2];
list(&$one, $two) = $a; // $a[0] is 1, $a[1] is 2
$one++; // $a[0] is 2, $a[1] is 2 list("one" => $one, "two" => $two) = ["one" => 1, "two" => 2]; // $one is 1, $two is 2
list( "one" => $one, "two" => $two,
) = [ "one" => 1, "two" => 2,
]; // $one is 1, $two is 2 $a = ['one' => 1, 'two' => 2];
list('one' => &$one, 'two' => $two) = $a; // $a['one'] is 1, $a['two'] is 2
$one++; // $a['one'] is 2, $a['two'] is 2 list(list("x" => $x1, "y" => $y1), list("x" => $x2, "y" => $y2)) = [ ["x" => 1, "y" => 2], ["x" => 3, "y" => 4]
]; // $x1 is 1, $y1 is 2, $x2 is 3, $y2 is 4
list(0 => list($x1, $x2), 1 => list($x2, $y2)) = [[1, 2], [3, 4]]; // $x1 is 1, $y1 is 2, $x2 is 3, $y2 is 4

