Syntax compound-assignment-expression: variable compound-assignment-operator assignment-expression compound-assignment-operator: one of **= *= /= %= += -= .= &lt;&lt;= &gt;&gt;= &amp;= ^= |= Constraints Any constraints that apply to the corresponding binary operator apply to the compound-assignment form as well. Semantics The expression e1 op= e2 is equivalent to e1 = e1 op (e2), except that e1 is evaluated only once. Examples $v = 10;
