Syntax yield-from-expression: yield from assignment-expression yield-expression: yield-from-expression yield yield yield-expression yield yield-from-expression =&gt; yield-expression Semantics Any function containing a yield-expression is a generator function . A generator function generates a collection of zero or more key/value pairs where each pair represents the next in some series. For example, a generator might yield random numbers or the series of Fibonacci numbers. When a generator function is called explicitly, it returns an object of type Generator , which implements the interface Iterator . As such, this allows that object to be iterated over using the foreach statement . During each iteration, the Engine calls the generator function implicitly to get the next key/value pair. Then the Engine saves the state of the generator for subsequent key/value pair requests. The yield operator produces the result NULL unless the method Generator->send was called to provide a result value. This operator has the side effect of generating the next value in the collection. If the key is omitted from an a yield-expression , an element key of type int is associated with the corresponding value. The key associated is one more than the previously assigned int key for this collection. However, if this is the first element in this collection with an int key, zero is used. If the value is also omitted, NULL will be used instead. If the generator function definition declares that it returns byRef, each value in a key/value pair is yielded byRef. The following applies only to the yield from form: A generator function (referred to as a delegating generator ) can delegate to another generator function (referred to as a subgenerator ), a Traversable object, or an array, each of which is designated by expression . Each value yielded by assignment-expression is passed directly to the delegating generator's caller. Each value sent to the delegating generator's send method is passed to the subgenerator's send method. If assignment-expression is not a generator function, any sent values are ignored. Exceptions thrown by assignment-expression are propagated up to the delegating generator. Upon traversable completion, NULL is returned to the delegating generator if the traversable is not a generator. If the traversable is a generator, its return value is sent to the delegating generator as the value of the yield from expression . An exception of type Error is thrown if assignment-expression evaluates to a generator that previously terminated with an uncaught exception, or it evaluates to something that is neither Traversable nor an array. Examples function getTextFileLines($filename)
{ $infile = fopen($filename, 'r'); if ($infile == FALSE) { /* deal with the file-open failure */ } try { while ($textLine = fgets($infile)) // while not EOF { $textLine = rtrim($textLine, "\r\n"); // strip off terminator yield $textLine; } } finally { fclose($infile); }
}
foreach (getTextFileLines("Testfile.txt") as $line) { /* process each line */ }
// -----------------------------------------
function series($start, $end, $keyPrefix = "")
{ for ($i = $start; $i <= $end; ++$i) { yield $keyPrefix . $i => $i; // generate a key/value pair }
}
foreach (series(1, 5, "X") as $key => $val) { /* process each key/val pair */ }
// -----------------------------------------
function gen()
{ yield 1; yield from gen2(); yield 4;
}
function gen2()
{ yield 2; yield 3;
}
foreach (gen() as $val)
{ echo $val . "\n"; // Produces the values 1, 2, 3, and 4
}
// -----------------------------------------
function g() { yield 1; yield from [2, 3]; yield 4;
}
$g = g();
foreach ($g as $yielded) { echo $yielded . "\n"; // Produces the values 1, 2, 3, and 4
}

