Syntax print-expression: yield-expression print print-expression Constraints print-expression value must be convertable to a string . In particular, it should not be an array and if it is an object, it must implement a __toString method . Semantics After converting print-expression 's value into a string, if necessary, print writes the resulting string to STDOUT . Unlike echo , print can be used in any context allowing an expression. It always returns the value 1. See also: double quoted strings and heredoc documents , conversion to string . Examples $v1 = TRUE;
$v2 = 123;
print '>>' . $v1 . '|' . $v2 . "<<\n"; // outputs ">>1|123<<"
print ('>>' . $v1 . '|' . $v2 . "<<\n"); // outputs ">>1|123<<"
$v3 = "qqq{$v2}zzz";
print "$v3\n"; // outputs "qqq123zzz"
$a > $b ? print "..." : print "...";

