Syntax expression: logical-inc-OR-expression-2 include-expression include-once-expression require-expression require-once-expression Semantics When creating large applications or building component libraries, it is useful to be able to break up the source code into small, manageable pieces each of which performs some specific task, and which can be shared somehow, and tested, maintained, and deployed individually. For example, a programmer might define a series of useful constants and use them in numerous and possibly unrelated applications. Likewise, a set of class definitions can be shared among numerous applications needing to create objects of those types. An include file is a script that is suitable for inclusion by another script. The script doing the including is the including file , while the one being included is the included file . A script can be an including file and an included file, either, or neither. Using the series-of-constants example, an include file called Positions.php might define the constants TOP, BOTTOM, LEFT, and RIGHT, in their own namespace , Positions. Using the set-of-classes example, to support two-dimensional geometry applications, an include file called Point.php might define the class Point. An include file called Line.php might define the class Line (where a Line is represented as a pair of Points).An include file, called Circle.php might define the class Circle (where a Circle is represented as a Point for the origin, and a radius). If a number of the scripts making up an application each use one or more of the Position constants, they can each include the corresponding include file via the include operator . However, most include files behave the same way each time they are included, so it is generally a waste of time including the same include file more than once into the same scope. In the case of the geometry example, any attempt to include the same include file more than once will result in a fatal "attempted class type redefinition" error. However, this can be avoided by using the include_once operator instead. The require operator is a variant of the include operator, and the require_once operator is a variant of the include_once operator. It is important to understand that unlike the C/C++ (or similar) preprocessor, script inclusion in PHP is not a text substitution process. That is, the contents of an included file are not treated as if they directly replaced the inclusion operation source in the including file. See examples below for more information. An inclusion expression can be written to look like a function call; however, that is not the case, even though an included file can return a value to its including file. The name used to specify an include file may contain an absolute or relative path. In the latter case, an implementation may use the configuration directive include_path to resolve the include file's location. Examples: As mentioned above, script inclusion in PHP is not a text substitution process (unlike C/C++'s preprocessor and alike). This allows that one can specify namespaces in the included file even though nested namespaces in a single file only are not permitted: include.php namespace foo;
$x = 'hello';
foo(); index.php namespace bar { include 'include.php'; // this is fine does not result in a nested namespace echo $x; // hello \foo\foo(); // function foo is still member of the foo namespace //namespace baz{} // would fail, nesting namespaces are not allowed
} Moreover, nested classes in a single file are not permitted whereas classes defined in an included file does not result in a nested class (in a conditionally defined class though) - the same applies for nested interfaces or traits: include.php namespace foo;
class Foo{} index.php class Bar{ function bar(){ include 'include.php'; // this is fine, does not result in a nested class } //class Foo1{} // would fail, nested classes are not allowed //interface Foo2{} // would fail as well //trait Foo3{} // and would fail as well
}
new Foo(); // fails, \Foo could not be found
new \foo\Foo(); // fails, definition for class Foo was not loaded yet
$bar = new Bar();
$bar->bar();
new Foo(); // still fails, include != use statement
new \foo\Foo(); // succeeds, definition for class Foo was loaded c-constants can not be defined within a function or method (in contrast to d-constants . As in the other examples above, this is perfectly legal when it happens through a file inclusion in which the constant does not lose its scope. Consider the following example: include.php namespace foo;
const X = 2; index.php class Bar{ function bar(){ include 'include.php'; }
}
echo X; // emits a warning: Use of undefined constant X ...
echo \foo\X; // same as above since the inclusion did not happen yet
$bar = new Bar();
$bar->bar();
echo X; // still fails, include != use statement
echo \foo\X; // succeeds, X was defined through the inclusion In contrast to constants, functions, classes, interfaces and traits, variables defined at the top level of a file might change their meaning (being a global variable) when the corresponding file is included by another file. This is the case when the inclusion happens in a local scope. In this case the variables become local variables of the corresponding scope. Following an example as illustration: include.php namespace foo;
$x = 'hello'; index.php function bar(){ include 'include.php'; // introduces the local variable $x $x = 'hi'; // modification is only local return $x;
}
echo bar(); // hi
echo $x; // emits a notice: Undefined variable: x ... include 'include.php'; // introduces the global variable $x
echo $x; // hello

