Syntax include-once-expression: include_once expression Semantics This operator is identical to operator include except that in the case of include_once, the same include file is included once per program execution. Once an include file has been included, a subsequent use of include_once on that include file results in a return value of TRUE but nothing else happens. The files are identified by the full pathname, so different forms of the filename (such as full and relative path) still are considered the same file. Examples: Point.php: \\ Point.php:
<?php ...
class Point { ... } \\ Circle.php:
<?php ...
include_once 'Point.php';
class Circle { /* uses Point somehow */ } \\ MyApp.php
include_once 'Point.php'; // Point.php included directly
include_once 'Circle.php'; // Point.php now not included indirectly
$p1 = new Point(10, 20);
$c1 = new Circle(9, 7, 2.4);

