Syntax switch-statement: switch ( expression ) { case-statementsopt } switch ( expression ) : case-statementsopt endswitch; case-statements: case-statement case-statementsopt default-statement case-statementsopt case-statement: case expression case-default-label-terminator statement-listopt default-statement: default case-default-label-terminator statement-listopt case-default-label-terminator: : ; Constraints There must be at most one default label. Semantics The two forms of the switch statement are equivalent; they simply provide alternate styles. Based on the value of its expression , a switch statement transfers control to a case label , to a default label , if one exists; or to the statement immediately following the end of the switch statement. A case or default label is only reachable directly within its closest enclosing switch statement. On entry to the switch statement, the controlling expression is evaluated and then compared with the value of the case label expression values, in lexical order, using the same semantics as ==. If one matches, control transfers to the statement following the corresponding case label. If there is no match, then if there is a default label, control transfers to the statement following that; otherwise, control transfers to the statement immediately following the end of the switch statement. If a switch contains more than one case label whose values compare equal to the controlling expression, the first in lexical order is considered the match. An arbitrary number of statements can be associated with any case or default label. In the absence of a break statement at the end of a set of such statements, the execution continues into any following statements, ignoring the associated labels. If all cases and the default end in break and there are no duplicate-valued case labels, the order of case and default labels is insignificant. Case-label values can be runtime expressions, and the types of sibling case-label values need not be the same. Switches may be nested, in which case, each switch has its own set of switch clauses. Examples $v = 10;
switch ($v)
{
default: echo "default case: \$v is $v\n"; break; // break ends "group" of default statements
case 20: echo "case 20\n"; break; // break ends "group" of case 20 statements
case 10: echo "case 10\n"; // no break, so execution continues to the next label's "group"
case 30: echo "case 30\n"; // no break, but then none is really needed either
}
// -----------------------------------------
$v = 30;
switch ($v)
{
case 30.0: // <===== this case matches with 30 echo "case 30.0\n"; break;
default: echo "default case: \$v is $v\n"; break;
case 30: // <===== rather than this case matching with 30 echo "case 30\n"; break;
}
// -----------------------------------------
switch ($v)
{
case 10 + $b: // non-constant expression // ...
case $v < $a: // non-constant expression // ...
// ...
}

