Syntax return-statement: return expressionopt ; Semantics A return statement from within a function terminates the execution of that function normally, and depending on how the function was defined , it returns the value of expression to the function's caller by value or byRef. If expression is omitted the value NULL is used. If execution flows into the closing brace (}) of a function, return NULL; is implied. Explicit return statements with expression given are not permitted within a function with a void return type and cause a fatal error. A function may have any number of return statements, whose returned values may have different types. If an undefined variable is returned byRef, that variable becomes defined, with a value of NULL. A return statement is permitted in a try-block and a catch-block and in finally-block . Using a return statement inside a finally-block will override any other return statement or thrown exception from the try-block and all its catch-blocks. Code execution in the parent stack will continue as if the exception was never thrown. If an uncaught exception exists when a finally-block is executed, if that finally-block executes a return statement, the uncaught exception is discarded. A return statement may occur in a script outside any function. In an included file , such statement terminates processing of that script file and returns control to the including file. If expression is present, that is the value returned; otherwise, the value NULL is returned. If execution flows to the end of the script, return 1; is implied. However, if execution flows to the end of the top level of a script, return 0; is implied. Likewise, if expression is omitted at the top level. (See also exit ). Returning from a constructor or destructor behaves just like returning from a function. A return statement inside a generator function causes the generator to terminate. A generator function can contain a statement of the form return expression ;. The value this returns can be fetched using the method Generator::getReturn, which can only be called once the generator has finishing yielding values. The value cannot be returned byRef. Return statements can also be used in the body of anonymous functions. return also terminates the execution of source code given to the intrinsic eval . Examples function f() { return 100; } // f explicitly returns a value
function g() { return; } // g explicitly returns an implicit NULL
function h() { } // h implicitly returns NULL
