The lifetime of a variable is the time during program execution that storage for that variable is guaranteed to exist. This lifetime is referred to as the variable's storage duration , of which there are three kinds: automatic, static, and allocated. A variable having automatic storage duration comes into being and is initialized at its declaration or on its first use, if it has no declaration. Its lifetime is delimited by an enclosing scope . The automatic variable's lifetime ends at the end of that scope. Automatic variables lend themselves to being stored on a stack where they can help support argument passing and recursion. Local variables , which include function parameters , have automatic storage duration. A variable having static storage duration comes into being and is initialized before its first use, and lives until program shutdown. The following kinds of variables have static storage duration: constants , function statics , global variables , static properties , and class and interface constants . A variable having allocated storage duration comes into being based on program logic by use of the new operator or a factory function. Ordinarily, once such storage is no longer needed, it is reclaimed automatically by the Engine via its garbage-collection process and the use of destructors . The following kinds of variables have allocated storage duration: array elements and instance properties . Although all three storage durations have default ends-of-life, their lives can be shortened by using the unset statement , which destroys any given set of variables. The following example demonstrates the three storage durations: class Point { ... } $av1 = new Point(0, 1); // auto variable $av1 created and initialized
static $sv1 = ...; // static variable $sv1 created and initialized function doit($p1)
{ $av2 = ...; // auto variable $av2 created and initialized static $sv2 = ...; // static variable $sv2 created and initialized if ($p1) { $av3 = ...; // auto variable $av3 created and initialized static $sv3 = ...; // static variable $sv3 created and initialized ... } global $av1; $av1 = new Point(2, 3); // Point(0,1) is eligible for destruction ...
} // $av2 and $av3 are eligible for destruction doit(TRUE); // At end of script, $av1, $sv1, $sv2, and $sv3 are eligible for destruction The comments indicate the beginning and end of lifetimes for each variable. In the case of the initial allocated Point variable whose handle is stored in $av1, its life ends when $av1 is made to point to a different Point. If function doit is called multiple times, each time it is called, its automatic variables are created and initialized, whereas its static variables retain their values from previous calls. Consider the following recursive function: function factorial($i)
{ if ($i > 1) return $i * factorial($i - 1); else if ($i == 1) return $i; else return 0;
} When factorial is first called, the local variable parameter $i is created and initialized with the value of the argument in the call. Then, if this function calls itself, the same process is repeated each call. Specifically, each time factorial calls itself, a new local variable parameter $i is created and initialized with the value of the argument in the call. The lifetime of any VStore or HStore can be extended by the Engine as long as needed. Conceptually, the lifetime of a VStore ends when it is no longer pointed to by any VSlots. Conceptually, the lifetime of an HStore ends when no VStores have a handle to it.

