In PHP, variables can be converted into some external form suitable for use in file storage or inter-program communication. The process of converting to this form is known as serialization while that of converting back again is known as unserialization . These facilities are provided by the library functions serialize and unserialize , respectively. In the case of variables that are objects, on their own, these two functions serialize and unserialize all the instance properties, which may be sufficient for some applications. However, if the programmer wants to customize these processes, they can do so in one of two mutually exclusive ways. The first approach is to define methods called __sleep and __wakeup, and have them get control before serialization and after serialization, respectively. For information on this approach, see __sleep and __wakeup . The second approach involves implementing the interface Serializable by defining two methods, serialize and unserialize. Consider a Point class that not only contains x- and y-coordinates, it also has an id property; that is, each distinct Point created during a program's execution has a unique numerical id. However, there is no need to include this when a Point is serialized. It can simply be recreated when that Point is unserialized. This information is transient and need not be preserved across program executions. (The same can be true for other transient properties, such as those that contain temporary results or run-time caches). Furthermore, consider a class ColoredPoint that extends Point by adding a color property. The following code shows how these classes need be defined in order for both Points and ColoredPoints to be serialized and unserialized: class Point implements Serializable // note the interface
{ private static $nextId = 1; private $x; private $y; private $id; // transient property; not serialized public function __construct($x = 0, $y = 0) { $this->x = $x; $this->y = $y; $this->id = self::$nextId++; } public function __toString() { return 'ID:' . $this->id . '(' . $this->x . ',' . $this->y . ')'; } public function serialize() { return serialize(array('y' => $this->y, 'x' => $this->x)); } The custom method serialize calls the library function serialize to create a string version of the array, whose keys are the names of the instance properties to be serialized. The insertion order of the array is the order in which the properties are serialized in the resulting string. The array is returned. public function unserialize($data) { $data = unserialize($data); $this->x = $data['x']; $this->y = $data['y']; $this->id = self::$nextId++; }
} The custom method unserialize converts the serialized string passed to it back into an array. Because a new object is being created, but without any constructor being called, the unserialize method must perform the tasks ordinarily done by a constructor. In this case, that involves assigning the new object a unique id. $p = new Point(2, 5);
$s = serialize($p); The call to the library function serialize calls the custom serialize method. Afterwards, the variable $s contains the serialized version of the Point(2,5), and that can be stored in a database or transmitted to a cooperating program. The program that reads or receives that serialized string can convert its contents back into the corresponding variable(s), as follows: $v = unserialize($s); The call to the library function unserialize calls the custom unserialize method. Afterwards, the variable $s contains a new Point(2,5). class ColoredPoint extends Point implements Serializable
