The predefined class Closure is used for representing an anonymous function . It cannot be instantiated except by the Engine, as described below. Closure objects are immutable and must not permit the creation or modification of properties. Closures can be bound , unbound or static . If a closure is said to be bound, then it has an object that $this will be bound to when called. If a closure is unbound, then it has no object $this will be bound to. If a closure is static, then it cannot be bound. Closures can be scoped or unscoped . If a closure is said to be scoped , it has a class scope which determines the visibility of the private and protected members of objects of the class, including but not limited to such members on $this. If a closure is said to be unscoped , it has no class scope set. Closures have an invariant that scoped closures must be bound or static, and unbound closures must be unscoped. class Closure
{ public static bind(Closure $closure, $newthis [, $newscope = "static" ]); public bindTo($newthis [, $newscope = "static" ]); public call($newthis [, ...$parameters ]);
} The class members are defined below: Name Purpose bind Duplicates closure $closure with a specific bound object $newthis and class scope $newscope. If $newthis is NULL then the closure is to be unbound if no scope is specified, or static if a scope is specified. $newscope is the scope the closure is to be given (either a string containing the name of a class, or an object whose class will be used), or "static" to keep the current one. Returns a new Closure object or FALSE on failure. This function must not violate the invariant that closures must either be both scoped and bound or static, or otherwise both unscoped and unbound. This function must prevent binding an object to the new closure if the $closure is static, however the new closure may have a different scope. bindTo Duplicates the closure designated by the current instance with a new-bound object and class scope. This method is an instance version of bind. call Calls the closure (the current instance) with $this bound to $newthis, the class scope of the class of $newthis, and the parameters specified by $parameters. This function must fail if $newthis is NULL, or if the closure is static. When the anonymous function creation operator is evaluated, the result is an object of type Closure (or some unspecified class derived from that type) created by the Engine. This object is referred to here as "the Closure object". This instance encapsulates the anonymous function defined in the corresponding anonymous-function-creation-expression . The contents of a Closure object are determined based on the context in which an anonymous function is created. Consider the following scenario: class C
{ public function compute() { $count = 0; $values = array("red" => 3, 10); $callback = function ($p1, $p2) use (&$count, $values) { ... }; ... }
} A Closure object may contain the following, optional dynamic properties, in order: static, this, and parameter. If an anonymous-function-creation-expression contains an anonymous-function-use-clause , a dynamic property called static is present. This is unrelated to whether a closure is said to be static . This property is an array having an element for each variable-name in the use-variable-name-list , inserted in lexical order of their appearance in the use clause. Each element's key is the corresponding variable-name , and each element value is the value of that variable at the time the time the Closure object is created (not when it is used to call the encapsulated function). In the scenario above, this leads to the following, shown as pseudo code: $this->static = array(["count"]=>&0,["values"]=>array(["red"]=>3,[0]=>10)); If an anonymous-function-creation-expression is used inside an instance method, a dynamic property called this is present. This property is a handle that points to the current instance. In the scenario above, this leads to the following, shown as pseudo code: $this->this = $this; If an anonymous-function-creation-expression contains a parameter-declaration-list , a dynamic property called parameter is present. This property is an array of one or more elements, each of which corresponds to a parameter. The elements are inserted in that array in lexical order of their declaration. Each element's key is the corresponding parameter name, and each element value is some unspecified value. (These values are overridden by the argument values used when the anonymous function is called). In the scenario above, this leads to the following, shown as pseudo code: $property = array("$p1" => ???, "$p2" => ???) It is possible for all three dynamic properties to be absent, in which case, the Closure object is empty. Closure objects can not be serialized or unserialized.

