This class supports the yield operator . This class cannot be instantiated directly. It is defined, as follows: class Generator implements Iterator
{ public function current(); public function getReturn(); public function key(); public function next(); public function rewind(); public function send($value) ; public function throw(Exception $exception) ; public function valid();
} The class members are defined below: Name Purpose current An implementation of the instance method Iterator::current . getReturn Returns the final expression from a generator, which was produced by a return statement rather than a yield. This function can only be called meaningfully once the generator has finishing yielding values; otherwise, an instance of Exception is thrown. key An implementation of the instance method Iterator::key . next An implementation of the instance method Iterator::next . rewind An implementation of the instance method Iterator::rewind . send This instance method sends the value designated by $value to the generator as the result of the current yield expression, and resumes execution of the generator. $value is the return value of the yield expression the generator is currently at. If the generator is not at a yield expression when this method is called, it will first be let to advance to the first yield expression before sending the value. This method returns the yielded value. throw This instance method throws an exception into the generator and resumes execution of the generator. The behavior is as if the current yield expression was replaced with throw $exception. If the generator is already closed when this method is invoked, the exception will be thrown in the caller's context instead. This method returns the yielded value. valid An implementation of the instance method Iterator::valid . Generator objects can not be serialized or unserialized.

