Syntax global-declaration: global variable-name-list ; variable-name-list: simple-variable variable-name-list , simple-variable Semantics A global variable is never defined explicitly; instead, it is created when it is first assigned a value. That may be done at the top level of a script, or from within a block in which that variable has been declared ( imported , that is) using the global keyword. One of the predefined variables , $GLOBALS is a superglobal array whose elements' key/value pairs contain the name and value, respectively, of each global variable currently defined. As such, a global variable gv can be initialized with the value v, and possibly be created, using the following form of assignment: $GLOBALS['gv'] = v As $GLOBALS is a superglobal, gv need not first be the subject of a global-declaration . A global variable has global scope and static storage duration . A global variable is a modifiable lvalue. When a global value is imported into a function, each time the function is called, that execution is dealing with an alias to that global variable. If that alias is passed to the unset statement , only that alias is destroyed. The next time that function is called, a new alias is created with the current value of the global variable. Undefined Global Variables The same rules as for undefined local variables apply. Examples $colors = array("red", "white", "blue");
$GLOBALS['done'] = FALSE;
// -----------------------------------------
$min = 10; $max = 100; $average = NULL;
global $min, $max; // allowed, but serves no purpose
function compute($p)
{ global $min, $max; global $average; $average = ($max + $min)/2; if ($p) { global $result; $result = 3.456; // initializes a global, creating it, if necessary }
}
compute(TRUE);
echo "\$average = $average\n"; // $average = 55
echo "\$result = $result\n"; // $result = 3.456
// -----------------------------------------
$g = 100;
function f()
{ $v = 'g'; global $$v; // import global $g ...
} Be also aware that declaring a variable global can hide a local variable and/or a function static with the same name. See static variables section for an example.

