General Syntax intrinsic: empty-intrinsic eval-intrinsic exit-intrinsic isset-intrinsic Semantics The names in this series of sections have special meaning and are called intrinsics , but they are not keywords; nor are they functions, they are language constructs that are interpreted by the Engine. empty Syntax empty-intrinsic: empty ( expression ) Semantics This intrinsic returns TRUE if the variable or value designated by expression is empty, where empty means that the variable designated by it does not exist, or it exists and its value compares equal to FALSE. Otherwise, the intrinsic returns FALSE. The following values are considered empty: FALSE, 0, 0.0, "" (empty string), "0", NULL, an empty array, and any uninitialized variable. If this intrinsic is used with an expression that designates a dynamic property , then if the class of that property has an __isset , that method is called. If that method returns TRUE, the value of the property is retrieved (which may call __get if defined) and compared to FALSE as described above. Otherwise, the result is FALSE. Examples empty("0"); // results in TRUE
empty("00"); // results in FALSE
$v = [10, 20];
empty($v); // results in FALSE eval Syntax eval-intrinsic: eval ( expression ) Constraints expression must designate a string, or be convertable to a string . The contents of the string must be valid PHP source code. If the source code is ill formed, an exception of type ParseError is thrown. The PHP source code in the string must not be delimited by opening and closing PHP tags . However, the source code itself may contain the tags. Semantics This intrinsic evaluates the contents of the string designated by expression , as PHP script code. Execution of a return statement from within the source code terminates the execution, and the value returned becomes the value returned by eval. If the source code is ill formed, eval returns FALSE; otherwise, eval returns NULL. The source code is executed in the scope of that from which eval is called. Examples $str = "Hello";
eval("echo \$str . \"\\n\";"); // → echo $str . "\n"; → prints Hello exit/die Syntax exit-intrinsic: exit exit ( expressionopt ) die die ( expressionopt ) Constraints When expression designates an integer, its value must be in the range 0–254. Semantics exit and die are equivalent. This intrinsic terminates the current script. If expression designates a string, that string is written to STDOUT . If expression designates an integer, that represents the script's exit status code . Code 255 is reserved by PHP. Code 0 represents "success". The exit status code is made available to the execution environment. If expression is omitted or is a string, the exit status code is zero. exit does not have a resulting value. exit performs the following operations, in order: Writes the optional string to STDOUT . Calls any functions registered via the library function register_shutdown_function in their order of registration. Invokes destructors for all remaining instances. Examples exit ("Closing down");
exit (1);
exit; isset Syntax isset-intrinsic: isset ( variable-list ,opt ) variable-list: variable variable-list , variable Semantics This intrinsic returns TRUE if all the variables designated by variables s are set and their values are not NULL. Otherwise, it returns FALSE. If this intrinsic is used with an expression that designate a dynamic property , then if the class of that property has an __isset , that method is called. If that method returns TRUE, the value of the property is retrieved (which may call __get if defined) and if it is not NULL, the result is TRUE. Otherwise, the result is FALSE. Examples $v = TRUE;
isset($v); // results in TRUE
$v = NULL;
isset($v); // results in FALSE
$v1 = TRUE; $v2 = 12.3; $v3 = NULL;
isset($v1, $v2, $v3); // results in FALSE

