Syntax anonymous-function-creation-expression: staticopt function &amp;opt ( parameter-declaration-listopt ) anonymous-function-use-clauseopt return-typeopt compound-statement anonymous-function-use-clause: use ( use-variable-name-list ) use-variable-name-list: &amp;opt variable-name use-variable-name-list , &amp;opt variable-name Semantics This operator returns an object of type Closure , or a derived type thereof, that encapsulates the anonymous function defined within. An anonymous function is defined like, and behaves like, a named function except that the former has no name and has an optional anonymous-function-use-clause . An expression that designates an anonymous function is compatible with the pseudo-type callable . The use-variable-name-list is a list of variables from the enclosing scope, which are to be made available by name to the body of the anonymous function. Each of these may be passed by value or byRef, as needed. The values used for these variables are those at the time the Closure object is created, not when it is used to call the function it encapsulates. An anonymous function defined inside an instance or static method has its scope set to the class it was defined in. Otherwise, an anonymous function is unscoped . An anonymous function defined inside an instance method is bound to the object on which that method is called, while an an anonymous function defined inside a static method, or prefixed with the optional static modifier is static , and otherwise an anonymous function is unbound . Examples function doit($value, callable $process)
{ return $process($value);
}
$result = doit(5, function ($p) { return $p * 2; }); // doubles a value
$result = doit(5, function ($p) { return $p * $p; }); // squares a value
