Syntax object-creation-expression: new class-type-designator ( argument-expression-listopt ) new class-type-designator ( argument-expression-list ,opt ) new class-type-designator new class ( argument-expression-listopt ) class-base-clauseopt class-interface-clauseopt { class-member-declarationsopt } new class class-base-clauseopt class-interface-clauseopt { class-member-declarationsopt } class-type-designator: qualified-name new-variable new-variable: simple-variable new-variable [ expressionopt ] new-variable { expression } new-variable -&gt; member-name qualified-name :: simple-variable relative-scope :: simple-variable new-variable :: simple-variable Constraints qualified-name must name a class. new-variable must be a value of type string that contains the name of a class, or an object. class-type-designator must not designate an abstract class . The number of arguments in argument-expression-list must be at least as many as the number of non-optional parameters defined for the class's constructor . Semantics The new class-type-designator forms create an object of the class type specified by class-type-designator . The new class forms create an object of an anonymous class type , a type that has an unspecified name. In all other respects, however, an anonymous class has the same capabilities as a named class type. If the class-type-designator is a new-variable resulting in a string value, that string is used as the class name. If the expression results in an object, the class of the object is used as the class for the new object. The new-variable has the same semantics as a variable , but the grammar is restricted to exclude calls. The qualified-name is resolved according to the rules described in scope resolution operator , including support for self, parent and static. After the object has been created, each instance property is initialized with the values specified in property definition , or the value NULL if no initializer value is provided. The object is then initialized by calling the class's constructor passing it the optional argument-expression-list . If the class has no constructor, the constructor that class inherits (if any) is used. The class can also specify no constructor definition, in this case the constructor call is omitted. The result of a named-type object-creation-expression is an object of the type specified by class-type-designator . The result of an anonymous class object-creation-expression is an object of unspecified type. However, this type will subtype all types provided by class-base-clause and class-interface-clause and the class-members definition should follow the same inheritance and implementation rules as the regular class declaration does. Each distinct source code expression of the form new class results in the class type that is different from that of all other anonymous class types. However, multiple evaluations of the same source code expression of the form new class result in instances of the same class type. Because a constructor call is a function call, the relevant parts of function call operator section also apply. Examples class Point
{ public function __construct($x = 0, $y = 0) { ... } ...
}
$p1 = new Point; // create Point(0, 0)
$p1 = new Point(12); // create Point(12, 0)
$cName = 'Point';
