Syntax function-call-expression: qualified-name ( argument-expression-listopt ) qualified-name ( argument-expression-list , ) callable-expression ( argument-expression-listopt ) callable-expression ( argument-expression-list , ) argument-expression-list: argument-expression argument-expression-list , argument-expression argument-expression: variadic-unpacking expression variadic-unpacking: ... expression Constraints callable-expression must designate a function, by being a value of type string that contains the function's name, or by being an object of a type that implements __invoke method (including Closure objects). The number of arguments present in a function call must be at least as many as the number of non-optional parameters defined for that function. No calls can be made to a conditionally defined function until that function exists. Any argument that matches a parameter passed byRef should (but need not) designate an lvalue. If variadic-unpacking is used, the result of the expression must be an array or Traversable . If incompatible value is supplied, the argument is ignored and a non-fatal error is issued. Semantics An expression of the form function-call-expression is a function call . The expression designates the called function , and argument-expression-list specifies the arguments to be passed to that function. An argument can be any value. In a function call, callable-expression is evaluated first, followed by each expression in the order left-to-right. There is a sequence point after each argument is evaluated and right before the function is called. For details of the result of a function call see return statement . The value of a function call is a modifiable lvalue only if the function returns a modifiable value byRef. When a function is called, the value of each argument passed to it is assigned to the corresponding parameter in that function's definition, if such a parameter exists. The assignment of argument values to parameters is defined in terms of simple or byRef assignment , depending on how the parameter was declared. There may be more arguments than parameters, in which case, the library functions func_num_args , func_get_arg and func_get_args can be used to get access to the complete argument list that was passed. If the number of arguments present in a function call is fewer than the number of parameters defined for that function, any parameter not having a corresponding argument is considered undefined if it has no default argument value ; otherwise, it is considered defined with that default argument value. If an undefined variable is passed using byRef, that variable becomes defined, with an initial value of NULL. Direct and indirect recursive function calls are permitted. If callable-expression is a string, this is a variable function call . If variadic-unpacking operation is used, the operand is considered to be a parameter list. The values contained in the operand are fetched one by one (in the same manner as foreach would do) and used for next arguments of for the call. The keys for in the iteration are ignored. Multiple unpacking operations can be used in the same function call, and unpacking and regular parameters can be mixed in any order. Examples function square($v) { return $v * $v; }
square(5); // call square directly; it returns 25
$funct = square; // assigns the string "square" to $funct
$funct(-2.3) // call square indirectly; it returns 5.29
strlen($lastName); // returns the # of bytes in the string
// -----------------------------------------
function f1() { ... } function f2() { ... } function f3() { ... }
for ($i = 1; $i <= 2; ++$i) { $f = 'f' . $i; $f(); }
// -----------------------------------------
function f($p1, $p2, $p3, $p4, $p5) { ... }
function g($p1, $p2, $p3, $p4, $p5) { ... }
function h($p1, $p2, $p3, $p4, $p5) { ... }
$funcTable = array(f, g, h); // list of 3 function designators
$i = 1;
$funcTable[$i++]($i, ++$i, $i, $i = 12, --$i); // calls g(2,3,3,12,11)
// -----------------------------------------
function f4($p1, $p2 = 1.23, $p3 = "abc") { ... }
f4(); // inside f4, $p1 is undefined, $p2 is 1.23, $p3 is "abc"
// -----------------------------------------
function f(&$p) { ... }
$a = array(10, 20, 30);
f($a[5]); // non-existent element going in, but element exists afterwards
// -----------------------------------------
function factorial($int) // contains a recursive call
{ return ($int > 1) ? $int * factorial($int - 1) : $int;
}
// -----------------------------------------
$anon = function () { ... }; // store a Closure in $anon
$anon(); // call the anonymous function encapsulated by that object

