Syntax member-access-expression: dereferencable-expression -&gt; member-name member-name: name simple-variable { expression } Constraints The dereferencable-expression must designate an object or be NULL, FALSE, or an empty string. expression must be a value of type string (but not a string literal) that contains the name of an instance property ( without the leading $) or an instance or static method of that instance's class type. Semantics A member-access-expression designates an instance property of the object designated by dereferencable-expression with the name given by the string representation of member-name . The value is that of the property, and is a modifiable lvalue if dereferencable-expression is a modifiable lvalue. When the -> operator is used in a modifiable lvalue context and member-name designate a property that is not visible, the property is treated as a dynamic property . If dereferencable-expression 's class type defines a __set method , it is called to store the property's value. When the -> operator is used in a non-lvalue context and member-name designate a property that is not visible, the property is treated as a dynamic property. If dereferencable-expression 's class type defines a __get method , it is called to retrieve the property's value. If dereferencable-expression is NULL, FALSE, or an empty string, an expression of the form $p->x = 10 causes an instance of stdClass to be created with a dynamic property x having a value of 10. $p is then made to refer to this instance. Examples class Point
{ private $x; private $y; public function move($x, $y) { $this->x = $x; // sets private property $x $this->y = $y; // sets private property $x } public function __toString() { return '(' . $this->x . ',' . $this->y . ')'; } // get private properties $x and $y public function __set($name, $value) { ... } public function __get($name) { ... }
}
$p1 = new Point;
$p1->move(3, 9); // calls public instance method move by name
$n = "move";
$p1->$n(-2, 4); // calls public instance method move by variable
$p1->color = "red"; // turned into $p1->__set("color", "red");
$c = $p1->color; // turned into $c = $p1->__get("color");

