Syntax scoped-property-access-expression: scope-resolution-qualifier :: simple-variable scoped-call-expression: scope-resolution-qualifier :: member-name ( argument-expression-listopt ) scope-resolution-qualifier :: member-name ( argument-expression-list , ) class-constant-access-expression: scope-resolution-qualifier :: name scope-resolution-qualifier: relative-scope qualified-name dereferencable-expression relative-scope: self parent static Constraints qualified-name must be the name of a class or interface type. dereferencable-expression must be a value of type string, which contains the name of a class or interface type, or an object. Semantics From inside or outside a class or interface, operator :: allows the selection of a constant. From inside or outside a class, this operator allows the selection of a static property, static method, or instance method. From within a class, it also allows the selection of an overridden property or method. If the scoped-property-access-expression form is used, this operator is accessing a static property given by simple-variable and can be used as an lvalue. If the class-constant-access-expression form is used, this operator is is accessing a class constant given by name . This form can not be used as an lvalue. If the scoped-call-expression form is used, the operator is calling the method given by member-anem , which, outside of the object context, is treated as static method call. Inside of the object context when $this is defined and the called method is not static and the called class is the same as a parent of the class of $this, then the method call is non-static with the same $this. Otherwise it is a static method call. relative-scope designates the class with relation to the current class scope. From within a class, self refers to the same class, parent refers to the class the current class extends from. From within a method, static refers to the class corresponds to the class inheritance context in which the method is called. This allows late static binding , when class resolution depends on the dynamic call context. class Base
{ public function b() { static::f(); // calls the most appropriate f() } public function f() { ... }
}
class Derived extends Base
{ public function f() { ... }
}
$b1 = new Base;
$b1->b(); // as $b1 is an instance of Base, Base::b() calls Base::f()
$d1 = new Derived;
$d1->b(); // as $d1 is an instance of Derived, Base::b() calls Derived::f() The value of the form of scope-resolution-expression ending in ::class is a string containing the fully qualified name of the current class, which for a static qualifier, means the current class context. Examples final class MathLibrary
{ public static function sin() { ... } ...
}
$v = MathLibrary::sin(2.34); // call directly by class name
$clName = 'MathLibrary';
$v = $clName::sin(2.34); // call indirectly via string
// -----------------------------------------
class MyRangeException extends Exception
{ public function __construct($message, ...) { parent::__construct($message); ... } ...
}
// -----------------------------------------
class Point
{ private static $pointCount = 0; public static function getPointCount() { return self::$pointCount; } ...
}

