Syntax clone-expression: primary-expression clone primary-expression Constraints primary-expression must designate an object. Semantics The clone operator creates a new object that is a shallow copy of the object designated by primary-expression . Then, if the class type of primary-expression has a method called __clone , it is called to perform a deep copy. The result is the new object. Examples Consider a class Employee, from which is derived a class Manager. Let us assume that both classes contain properties that are objects. clone is used to make a copy of a Manager object, and behind the scenes, the Manager object uses clone to copy the properties for the base class, Employee. class Employee
{ //... public function __clone() { // make a deep copy of Employee object }
}
class Manager extends Employee
{ //... public function __clone() { $v = parent::__clone(); // make a deep copy of Manager object }
}
$obj1 = new Manager("Smith", 23);
$obj2 = clone $obj1; // creates a new Manager that is a deep copy

