Syntax unary-op-expression: unary-operator unary-expression unary-operator: one of + - ~ Constraints The operand of the unary + and unary - must have scalar-compatible type. The operand of the unary ~ operator must have arithmetic or string type, or be an object supporting ~. Semantics Arithmetic Operands For a unary + operator used with an arithmetic operand, the type and value of the result is the type and value of the operand. For a unary - operator used with an arithmetic operand, the value of the result is the negated value of the operand. However, if an int operand's original value is the smallest representable for that type , the operand is treated as if it were float and the result will be float. For a unary ~ operator used with an int operand, the type of the result is int. The value of the result is the bitwise complement of the value of the operand (that is, each bit in the result is set if and only if the corresponding bit in the operand is clear). For a unary ~ operator used with a float operand, the value of the operand is first converted to int before the bitwise complement is computed. Boolean Operands For a unary + operator used with a TRUE-valued operand, the value of the result is 1 and the type is int. When used with a FALSE-valued operand, the value of the result is zero and the type is int. For a unary - operator used with a TRUE-valued operand, the value of the result is -1 and the type is int. When used with a FALSE-valued operand, the value of the result is zero and the type is int. NULL-valued Operands For a unary + or unary - operator used with a NULL-valued operand, the value of the result is zero and the type is int. String Operands For a unary + or - operator used with a numeric string or a leading-numeric string, the string is first converted to an int or float, as appropriate, after which it is handled as an arithmetic operand. The trailing non-numeric characters in leading-numeric strings are ignored. With a non-numeric string, the result has type int and value 0. If the string was leading-numeric or non-numeric, a non-fatal error MUST be produced. For a unary ~ operator used with a string, the result is the string with each byte being bitwise complement of the corresponding byte of the source string. Object Operands If the operand has an object type supporting the operation, then the object semantics defines the result. Otherwise, for ~ the fatal error is issued and for + and - the object is converted to int . Examples $v = +10;
if ($v1 > -5) // ...
$v = ~0b1010101;
$s = "\x86\x97"; $s = ~$s; // $s is "yh"

