Syntax error-control-expression: @ unary-expression Semantics Operator @ suppresses the reporting of any error messages generated by the evaluation of unary-expression . If a custom error-handler has been established using the library function set_error_handler , that handler is still called. Examples $infile = @fopen("NoSuchFile.txt", 'r'); On open failure, the value returned by fopen is FALSE, which is sufficient to know to handle the error. The error message that may have been generated by the fopen call is suppressed (not displayed and not logged). Implementation Notes Given the following example: function f() { $ret = $y; return $ret;
} $x = @f(); // without @, get "Undefined variable: y" The following code shows how this statement is handled: $origER = error_reporting();
error_reporting(0);
$tmp = f();
$curER = error_reporting();
if ($curER === 0) error_reporting($origER);
$x = $tmp;

