Syntax instanceof-expression: unary-expression instanceof-subject instanceof class-type-designator instanceof-subject: instanceof-expression Semantics Operator instanceof returns TRUE if the value designated by instanceof-subject is an object having the type specified by class-type-designator , is an object whose type is derived from that type, or is an object whose type implements the interface specified by class-type-designator . Otherwise, it returns FALSE. The type can be specified by class-type-designator in one of the three forms: qualified-name specifies the type name directly. When the new-variable form is used, new-variable may have a string value that contains a class or interface name. Alternatively, new-variable can designate an object, in which case the type of the object is used as the specified type. Note that an interface can not be specified with this form. Note that instanceof will not invoke autoloader if the name of the type given does not correspond to the existing class or interface, instead it will return FALSE. Examples class C1 { }
$c1 = new C1;
class C2 { }
$c2 = new C2;
class D extends C1 { };
$d = new D;
var_dump($d instanceof C1); // TRUE
var_dump($d instanceof C2); // FALSE
var_dump($d instanceof D); // TRUE
// -----------------------------------------
interface I1 { }
interface I2 { }
class E1 implements I1, I2 { }
$e1 = new E1;
var_dump($e1 instanceof I1); // TRUE
$iName = "I2";
var_dump($e1 instanceof $iName); // TRUE
$e2 = new E1;
var_dump($e2 instanceof $e1); // TRUE
